import React from "react";
import {Area,Button} from './myInput.js';
const Myinput = (props) => {
  return (
    <FormInp>
      <Area
        value={props.value}
        placeholder="введите пост"
        onChange={props.onchange}



        /> <br/>
      <Button onClick={props.onclick}> создать пост</Button>
    </FormInp>
  );
};

export default Myinput;
